window.bookSummaryJSON = "<p>Mack Sutton is a normal guy who just happens to attend a very abnormal school. In a college where the pretty girls can kill you with a whisper and most of the guys can bench press a car, Mack and his sister Jetta are just run of the mill people—or are they? </p> <p>Formerly printed as a Kindle Vella, this is a novel of the Demon Accords that gives a glimpse into the lives of the only non-supernatural kids in College Arcane.</p>"; 
